        '360008429480':
            title: '¡Bienvenido a tu Centro de ayuda! (CAMBIÓ)'
            body: "<p> (MODIFICADO) Estás viendo tu nuevo <a href=\"https://www.zendesk.com/self-service\"> Centro de ayuda </a> . Lo completamos con contenido de marcador de posición para ayudarlo a comenzar. Siéntase libre de editar o eliminar este contenido. </p>\n <p> El Centro de ayuda está diseñado para proporcionar una opción de soporte de autoservicio completa para sus clientes. El Centro de ayuda consta de dos partes: una base de conocimientos y una comunidad. Sus clientes pueden buscar artículos de la base de conocimientos para aprender una tarea o buscar en la comunidad y hacer preguntas a otros usuarios. Si sus clientes no pueden encontrar una respuesta, pueden enviar una solicitud de soporte. </p>\n <p> Para obtener más información, consulte la <a href=\"https://support.zendesk.com/hc/en-us/articles/203664386\"> guía del Centro de ayuda para usuarios finales </a> . </p>\n <p> Cada usuario de su comunidad tiene un perfil del Centro de ayuda (solo Guide Professional), por lo que los miembros de su comunidad pueden conocerse mejor. Los perfiles contienen información relevante sobre el miembro de la comunidad, junto con sus actividades y contribuciones a la comunidad. Los perfiles también le dan a cada miembro de la comunidad la opción de seguir a otro usuario y recibir notificaciones cuando ese usuario hace una publicación o comentario. </p>"
