        3310b2dc-545d-4200-82a9-b672d017efd4:
            body: '<p> <img alt="ua" src="https://navi.gg/source/flags/ua.png" title=""> Oleksandr &quot; <strong> ejemplo </strong> &quot; &iexcl;Kostyliev ha batido su r&eacute;cord personal de m&aacute;xima audiencia online en <strong> Twitch! </strong> <img alt="ua" src="https://navi.gg/source/flags/ua.png" title=""> &nbsp; <strong> Natus Vincere </strong> transmitido a m&aacute;s de 83 mil personas!</p><p> <img alt="" src="https://navi.gg/upload/gnss/chrome_2021-03-05_17-12-52.png" title=""><br><em> Estad&iacute;sticas de audiencia de la transmisi&oacute;n sin precedentes </em></p><p> El r&eacute;cord se estableci&oacute; durante la transmisi&oacute;n el 4 de marzo. <img alt="ua" src="https://navi.gg/source/flags/ua.png" title=""> &nbsp; <strong> s1mple </strong> estaba jugando los partidos de <strong> FPL </strong> en el mismo equipo que <img alt="us" src="https://navi.gg/source/flags/us.png" title=""><strong> Team Liquid </strong> &nbsp; capit&aacute;n <img alt="br" src="https://navi.gg/source/flags/br.png" title=""> Gabriel <strong> &quot; FalleN &quot; </strong> Toledo. &iexcl;Los partidos fueron muy entretenidos!</p><p> Adem&aacute;s, este resultado permiti&oacute; a Oleksandr ocupar el primer lugar en t&eacute;rminos de audiencia online entre todos los jugadores profesionales de Twitch en la categor&iacute;a <strong> Counter-Strike: Global Offensive </strong> . Los perseguidores m&aacute;s cercanos de <img alt="ua" src="https://navi.gg/source/flags/ua.png" title=""><strong> s1mple </strong> era <img alt="ca" src="https://navi.gg/source/flags/ca.png" title=""> Michael <strong> &quot; sudario &quot; </strong> Grzesiek y <img alt="br" src="https://navi.gg/source/flags/br.png" title=""> Fernando &nbsp; <strong> &quot; fer &quot; </strong> &nbsp; Alvarenga, que fueron vistos por un m&aacute;ximo de 66.000 y 63.000 espectadores respectivamente.</p>'
