    '39140841':
        2cc794d6-43eb-4427-9f91-319b38ee6ff9:
            body: "La tan esperada adaptación en vivo de Halo tiene una nueva fecha de lanzamiento, así como una nueva red. Ahora está programado para emitirse en el primer trimestre de 2022, como un programa insignia en el nuevo servicio de transmisión de Paramount +. \n\n Paramount +, a su vez, es un cambio de marca del servicio de transmisión actual de ViacomCBS, CBS All Access. Está previsto que se vuelva a lanzar el 4 de marzo y ofrecerá una gama más amplia de contenido que CBS All Access. \n\n La noticia de Halo fue parte de una serie de anuncios hechos desde el lote de Paramount Studios el miércoles por la tarde, como parte de un evento de tres horas que presentó los planes actuales de ViacomCBS para Paramount +. Según se informa, esto incluye la adición de más de 30,000 episodios y películas de las diversas marcas bajo el paraguas de Viacom, como Comedy Central y MTV, además de transmisiones en vivo de deportes y noticias."
            titile: 'El programa de televisión ''Halo'' se transmitirá en 2022, junto con ''Star Trek'', en el nuevo servicio de transmisión de Paramount +'
